    {
        title: 'abc',
        body: 'abchhdhdbfbfhdhdfdf jfdjhfd fdhjhdjf dhjdhfjd djhfd'
    }
];
class NotesComponent extends Component {
    state = {
        notesList: notesList
    }

    render() {
        return (
            <>
                <HeaderComponent />
                <div className="row h-100">

                    <div className="col-sm-4 h-100 notes-list-cs">
                        <div className="left-list-box">
                            {this.state.notesList.map((note, index) => (
                                <div key={index} className="list-box">
                                    <div className="title-cs">{note.title}</div>
                                    <div className="body-cs">{note.body}</div>
                                </div>
                            ))}
                        </div>

                    </div>

                    <div className="col-sm-8 add-note-box">
                        <div className="add-note-btn">
                            <button className="pull-right btn">
                                + Add Note
                            </button>
                        </div>
                    </div>
                </div>
            </>
        );
    }
}

export default NotesComponent;
